import { Application, DatePicker } from 'react-rainbow-components';
import React, { useEffect, useState } from 'react';
import { useTheme } from "@mui/material";
import { tokens } from "../theme";
import styled from 'styled-components';

// // Custom styled button with your desired color
// const StyledButton = styled(Button)`
//   background-color: ${({ theme }) => theme.rainbow.palette.brand};
// `;

const initialState = {
    range: undefined,
};
const containerStyles = {
    maxWidth: 400,
};

const Search = () => {
    const Mytheme = useTheme();
    const colors = tokens(Mytheme.palette.mode);
    const theme = {
        rainbow: {
            palette: {
                brand: colors.primary[300],
                mainBackground: colors.primary[200],
                border: colors.primary[200],
                text: colors.grey[100],
            },
        },
    };

    return (
        <div className="dash" style={{ paddingLeft: '20px' }}>
            <h1>Search</h1>
            <div
                className="rainbow-align-content_center rainbow-m-vertical_large rainbow-p-horizontal_small rainbow-m_auto"
                style={theme}
            >
                <Application theme={theme} className='testttttt'>
            <DatePicker
                id="datePicker-15"
                label="DatePicker Label"
                placeholder="Select range of dates"
                selectionType="range"
                formatStyle="large"
                variant="single"
                // value={state.range}
                // onChange={value => setState({ range: value })}
            />
            </Application>
            </div>
        </div>
    )
}

export default Search;
